        //获取行政区平均PM25排名
        Get_CantonAverageOHI: function () {
            $.ajaxHandle({
                url: ACTION_URL("Get_CantonAverageOHI", "Manager"),
                data: {
                },
                loading: true,
                success: function (response) {
                    var time = new Date(parseInt(response[0].TIME.replace("/Date(", "").replace(")/", ""))).getMonth() + 1;
                    $.each(response, function (index, ele) {
                        $("#aqi_" + (index + 1) + "_name").html(ele.DIMREGIONNAME);
                        //$("#aqi_" + (index + 1) + "_name").addClass("td_name");
                        $("#aqi_" + (index + 1)).html(ele.NUM.toFixed(2));
                        $("#hb_" + (index + 1)).html(((ele.PM_HB) * 100).toFixed(1) + "%（环）");
                        if (ele.PM_TB == 0) {
                            $("#tb1_" + (index + 1)).html("—");
                        } else {
                            $("#tb1_" + (index + 1)).html(((ele.PM_TB) * 100).toFixed(1) + "%（同）");
                        }
                    })
                    $("#nowMouth").html("PM2.5排行（" + time + "月）");
                }
            });
        },

